var imageAs64 = "";

var URL = 'https://vision.googleapis.com/v1/images:annotate?key=';

//the request to be made to the Google Vision API
var request = {
    requests: [{
        image: {
            content: imageAs64
        },
        features: [
            {
                type: "LABEL_DETECTION",
                maxResults: 3
            },
            {
                type: "LOGO_DETECTION",
                maxResults: 3
            },
            {
                type: "TEXT_DETECTION",
                maxResults: 10
            }

        ]
    }]
};

/**
 * Makes a request to the Google Vision API
 * @param APIkey the API key
 */
function makeRequest(APIkey) {
    $.ajax({
        type: 'POST',
        url: URL + APIkey,
        data: JSON.stringify(request),
        contentType: "application/json",
        dataType: 'json'
    }).fail(function () {
        console.log("Request to API failed");
    }).done(function (response) {
        return response
    })
}

function displayJSONResults(response) {
    console.log(response);
    console.log(response.responses[0].labelAnnotations[0]);


}















